import React, { Component } from 'react';
import Tree123 from '../Components/Tree123';
import axios from "axios" ;
function func_delete()
{
    axios({
        // Endpoint to send files
        url: " http://localhost:5000/funcdelete"  ,
        method: "GET" ,
        headers: {},
        })
        .then((res) => { alert("Данные удалены")}) // Handle the response from backend here
        . catch ((err) => { alert ("все плохо")}); // Catch errors if any
}
class DBNav extends Component {
    render() {
        return (
            <div>
                <div class="d-grid gap-2 col-6 mx-auto">
                    <button type="submit" class="btn btn-outline-secondary text-center mt-3" onClick={func_delete}>Очистить базу данных</button>
                </div>
                <Tree123 goal_url="treesmkb" />
            </div>
        );
    }
}

export default DBNav;
